import React, { useEffect, useState } from "react";
import "../Admin/AdminLogin.css";
import { Link  } from "react-router-dom";
import { login } from './actions';
import { Container, Form, Row, Col, Button } from "react-bootstrap";
import { useDispatch, useSelector } from "react-redux";
import { Navigate } from 'react-router-dom';
import { isUserLoggedIn } from "./actions/auth.actions";
import Input from '../Input';


function AdminLogin() {
    return (

        <div className="container">
        <div className="row">
            <div className="col-sm-6">
            <img src="images/Admin/logo3.jpg" className="login-logo" alt="..."/>
            </div>
            <div className="col-sm-6">
                <div className="right-column text-center">
                <img src="images/Admin/men1.png" className="signup-logo" alt="..."/>
                    <p className="info">Sign up to see photos and videos from your friends.</p>
                    {/* <button type="submit" className="btn btn-primary btn-block">
                    <img src={Google} alt="..."/>Log in with Google
                    </button> */}
                    <p className="or">OR</p>
                    <form>
                        <div className="form-group">
                            <input type="text" className="form-control" placeholder="Username"/>
                        </div>
                        <div className="form-group">
                            <input type="password" className="form-control" placeholder="Password"/>
                        </div>
                        <Link to="/adminDashboard"><button type="submit" className="signup btn-primary btn-block">Login</button></Link>
                    </form>
                </div>
                <div className="right-column-login text-center">
                <a href="#">Forgot Password?</a>
                </div>
            </div>
        </div>
    </div>
    );
}
export default AdminLogin;
